import React from 'react';
import './App.css';
import Main from './Components/Main'
import FormPractice from './Components/FormPractice';
import Api from './Components/Api'

function App() {
  return (
    <div className="text-center">
      <Main />
      <FormPractice />
      <Api />
    </div>
  );
}

export default App;
